  /// กิจกรรมแปลง
  GetTarget(){
    let time = (new Date(this.FormTrackCane.get('selettime').value).getTime()/1000);
    const date = new Date(this.FormTrackCane.get('selettime').value)
    let day = date.toLocaleDateString('th-TH', {
      year: 'numeric',
      month: 'long',
      day: 'numeric',
    })
    this.today = day;
    this.spinner.show();
    let url = 'https://asia-southeast2-brr-farmluck.cloudfunctions.net/brdsqlapi/supervisMonitorMay2021ByDate?lastdate='+time ;
    fetch(url)
      .then(res => res.json())
      .then((out: any) => {
        const data = out.recordsets[0];
        let allbrd = data.filter(element => element.Partcode =="BRD")
        let Zone = data.filter(element => element.supcode =="Z" && element.Partcode !=="BRD")
        // let Supsum = data.filter(element => element.SUPNAME ==="*รวมนสส." && element.Partcode !=="BRD" )
        let alldata = data.filter(element => element.Partcode !=="BRD" && element.supcode !=="Z")
        this.actionplanallbrd = allbrd;
        this.actionplanallZone = Zone;
        this.actionplanmaindata = alldata;
        // console.log(alldata)

      })
    .catch(err => { throw err });



    setTimeout(() => {
      this.spinner.hide();
    }, 5000);
  }

